import './App.css';
import List from "./components/List";
function App() {  

  return (
    <div className="App">
      <header className="App-header">

        <div>LOGO</div>
        <form method="GET" action="/">
            <input type="search" name="serched" placeholder="Search books here" className="searchInput"/>
            <button className="searchButton"><b>Search</b></button>
        </form>
        <div><i className="menuIcon"/></div>
      </header>
      <div>
        <List />
      </div>
      <footer>
        <p>@Uxer Company limited</p>
      </footer>
    </div>
  );
}

export default App;
